import React from 'react';
import Slider from '../../Component/Slider';
import necklesImage from '../../Component/Pages/image/neckles.jpg';

function Home() {
  return (
    <div>
      <Slider/>
      <section className="section bg-c-light border-top">
        <div className="container">
          <div className="row">
            <div className="col-md-12 nb-4 text-center">
              <h1 className="main-heading">Accessories</h1>
            </div>
            <div className="col-md-4">
              <div className="card shadow">
                <img src={necklesImage} className='w-100 border-bottom' alt='accessories' />
                <div className="card-body">
                
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Home;
